import React from 'react'

function TotalInfo() 
{
  const [panCardDetails, setPanCardDetails] = useState({
  salutation: '',
  fullName: '',
  dateOfBirth: '',
});

const [propertyDetails, setPropertyDetails] = useState({
  pincode: '',
  flatNo: '',
  areaStreet: '',
  isCurrentAddress: '',
});

const handlePanCardChange = (e) => {
  setPanCardDetails({
    ...panCardDetails,
    [e.target.name]: e.target.value,
  });
};

const handlePropertyChange = (e) => {
  setPropertyDetails({
    ...propertyDetails,
    [e.target.name]: e.target.value,
  });
};

const handleProceed = () => {
  // Implement the logic to proceed to the next step or perform any necessary actions
  console.log('Proceed to the next step:', { panCardDetails, propertyDetails });
};

return (
  <div>
    <h1>Fill the details</h1>

    <div>
      <h2>Enter PanCard details:</h2>
      <label>
        Salutation:
        <select name="salutation" value={panCardDetails.salutation} onChange={handlePanCardChange}>
          <option value="Mr">Mr</option>
          <option value="Mrs">Mrs</option>
          <option value="Ms">Ms</option>
        </select>
      </label>

      <br />

      <label>
        Full Name (As per Pancard):
        <input
          type="text"
          name="fullName"
          value={panCardDetails.fullName}
          onChange={handlePanCardChange}
        />
      </label>

      <br />

      <label>
        Date of Birth (As per Pancard):
        <input
          type="text"
          name="dateOfBirth"
          value={panCardDetails.dateOfBirth}
          onChange={handlePanCardChange}
          placeholder="dd/mm/yyyy"
        />
      </label>
    </div>

    <div>
      <h2>Property details</h2>
      <label>
        Pincode:
        <input
          type="text"
          name="pincode"
          value={propertyDetails.pincode}
          onChange={handlePropertyChange}
        />
      </label>

      <br />

      <label>
        Flat No/House No:
        <input
          type="text"
          name="flatNo"
          value={propertyDetails.flatNo}
          onChange={handlePropertyChange}
        />
      </label>

      <br />

      <label>
        Area/Street:
        <input
          type="text"
          name="areaStreet"
          value={propertyDetails.areaStreet}
          onChange={handlePropertyChange}
        />
      </label>

      <br />

      <label>
        Is the address mentioned above your current address:
        <select
          name="isCurrentAddress"
          value={propertyDetails.isCurrentAddress}
          onChange={handlePropertyChange}
        >
          <option value="yes">Yes</option>
          <option value="no">No</option>
        </select>
      </label>

      <br />

      {propertyDetails.isCurrentAddress === 'no' && (
        <div>
          {/* Additional fields for current address */}
          {/* Implement these fields as needed */}
          {/* <label>
            Current Address:
            <input
              type="text"
              name="currentAddress"
              value={propertyDetails.currentAddress}
              onChange={handlePropertyChange}
            />
          </label>
          <br /> */}
        </div>
      )}

      <br />

      <button onClick={handleProceed}>Proceed</button>
    </div>
  </div>
);
}

export default TotalInfo
